import React from 'react';
import './Input.css';


class Input extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            placeholder: "Notation..."
        }
    }

    render() {
        return (
            <form id="Input"> 
                <input placeholder={this.state.placeholder} />
            </form>
        );
    }
}

export default Input;
